('2366','18','7859','Villa Shepherd',Null,'Gepflegtes Einfamilienhaus im mediterranen Stil in Santa Ponsa zu verkaufen','33310','Santa Ponsa liegt im Südwesten Mallorcas und bietet Sommer wie Winter eine gut funktionierenden Infrastruktur. Nur wenige Gehminuten vom Hausentfernt befinden sich ein Jachtclub und eine Badebucht.\r\nDas Haus befindet sich auf einem ca 1.000m² großen Grundstück in einem sehr gepflegten Zustand. Ein hübsch angelegter mediterraner Garten umgibt das Haus mit 2 Wohnetagen mit ca 245m² Wohnfläche. Insgesamt bietet diese Immobilie 5 Schlafzimmer und 4 Badezimmer. Ein Klimaanlage w/k sorgt Sommer wie Winter für die richtige Temperatur. Entspannen kann man am Pool. 2 Autos finden Platz in der Garage\r\n','33311','995000','106','2015-08-19 15:27:38','106','2015-08-19 15:28:50',Null,'2452','121','1151',1,'1','0',Null,Null,Null,'33312',Null,'0','0','0',Null,'2015-08-19 15:31:59',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33313',Null,'33314',Null,'33315',Null,'33316','699242659','33317','0',0,'4');
